import React from 'react';
import './App.css';
import Fruits from './Fruits';

const calculate = (a, b) => {
  const add = a + b;
  const subtract = a - b;
  const multiply = a * b;
  const divide = a / b;

  const arr = [add, subtract, multiply, divide];
  return arr;
}

const App = () => {
  const arr = calculate(4, 7);

  return (
    <React.Fragment>
      <Fruits name="Jeel" age="21" />
      <p>
        Sum: {arr.add}
      </p>
      <p>
        Sub: {subtract}
      </p>
      <p>
        Production: {multiply}
      </p>
      <p>
        Division: {divide}
      </p>
    </React.Fragment>
  );
}

export default App;
